import React from 'react';
import styled from 'styled-components';
import { NavLink } from 'react-router-dom';
import { colors, demotion, elevation, setFlex, fixed } from '../utilities';
import Cash from '../elements/svg/Cash';
import Lighting from '../elements/svg/Lighting';


const CondicionesRentaBase = ({className}) => {
    return (
        <div className={className}>
            <div className="price">
                <Cash className="rent_icon" size="60"/>
                <div className="list">
                    <li className="txt-cond-rent">Por evento diario(tiempo libre durante el dia).</li>
                    <li className="txt-cond-rent"> Más IVA en caso de requerir factura.</li>
                </div>
            </div>
            <div className="light">
                <Lighting className="rent_icon" size="60"/>
                <div className="list">
                    <li className="txt-cond-rent">Por evento diario(tiempo libre durante el dia).</li>
                    <li className="txt-cond-rent"> Más IVA en caso de requerir factura.</li>
                </div>
            </div>


        </div>
    );
};

const CondicionesRenta = styled(CondicionesRentaBase)`
    position: relative;
    width: 100%;
    margin-top: 8rem;
    margin-left: 1rem;

    .rent_icon{
        display: inline-block;
    }

    .list{
        display: inline-block;
        margin-left: 1rem;
        list-style-type: square;
    }

    .txt-cond-rent{
        color: ${colors.white_1};
        font-size: .9rem;
        letter-spacing: .1rem;
        margin: auto 6rem;
        line-height: 1.4rem;
        padding-bottom: 0.7rem;
    }


`



export default CondicionesRenta;
